import Mathlib

def Quaternion : Type := {x : ℝ | ∃ a b c d : ℝ, x =
  a*1 + b*i + c*j + d*k}

noncomputable def i : Quaternion := {x : ℝ | ∃ a b c d : ℝ, x =
  a*0 + b*1 + c*0 + d*0}

noncomputable def j : Quaternion := {x : ℝ | ∃ a b c d : ℝ, x =
  a*0 + b*0 + c*1 + d*0}

noncomputable def k : Quaternion := {x : ℝ | ∃ a b c d : ℝ, x =
  a*0 + b*0 + c*0 + d*1}

noncomputable def unit : Quaternion = {1}

noncomputable def cbrt : Quaternion → ℝ :=
  fun (x : Quaternion) ↦ if 0 ≤ x.re then x.re else -(x.re)

theorem autoformalized_theorem_2299 : ¬ Set.Finite {x : Quaternion | unit*x*i unit*x*i = -1} := by sorry
